import React from 'react';
import './App.css';

function App() {
  return (
    <div className="App">
      <h1>CRUD APP</h1>

      <div className="form">
        <input type="text" name="movieName"/>
        <input type="text" name="review"/>
      </div>
    </div>

  );
}

export default App;
